import React, { useState, useEffect, useRef } from 'react';
import './MultiChatXpertPage.css';
import userImage from './images/Chips.png';
import aiImage from './images/BreachHours.jpg';
import axios from 'axios';

function MultiChatXpertPage() {
  const [messages, setMessages] = useState([]);
  const [experts, setExperts] = useState([
    "Expert 1", "Expert 2", "Expert 3", "Expert 4", "Expert 5",
    "Expert 6", "Expert 7", "Expert 8", "Expert 9", "Expert 10",
    "Expert 11", "Expert 12", "Expert 13", "Expert 14", "Expert 15"
  ]);
  const [expertStatus, setExpertStatus] = useState(Array(15).fill(false)); // Tracks toggle state for AI Image Popup
  const [isExpertPopupOpen, setExpertPopupOpen] = useState(false);
  const [currentLLM, setCurrentLLM] = useState(null);

  // Toggle expert selection in AI Image Popup
  const toggleExpert = (index) => {
    const updatedStatus = [...expertStatus];
    updatedStatus[index] = !updatedStatus[index];
    setExpertStatus(updatedStatus);
  };

  // Toggle the AI Expert Popup
  const toggleExpertPopup = () => {
    setExpertPopupOpen(!isExpertPopupOpen);
  };

  // Function to handle updating an expert's name in the settings console
  const updateExpertName = (index, newName) => {
    const updatedExperts = [...experts];
    updatedExperts[index] = newName;
    setExperts(updatedExperts);
  };

  const handleSendMessage = async (message) => {
    try {
      const response = await axios.post(
        'https://bada-2601-702-0-9480-e902-94e6-a4ed-8872.ngrok-free.app/api/analyze_text/',
        {
          text: message,
          selected_experts: expertStatus,  // Send the expert toggled status
          selected_option: currentLLM      // LLM option
        },
        {
          headers: { 'X-CSRFToken': getCsrfToken() },
          withCredentials: true
        }
      );
      const aiText = response.data.output || "No response from AI";
      setMessages((prevMessages) => [...prevMessages, { text: aiText, isUser: false }]);
    } catch (error) {
      console.error('Error sending message to backend:', error);
    }
  };

  return (
    <div className="my-ui-container">
      {/* AI Image Container */}
      <div className="ai-container">
        <button className="ai-image" onClick={toggleExpertPopup}>
          <img src={aiImage} alt="AI Expert" />
        </button>
      </div>

      {/* AI Expert Popup with Toggle Functionality */}
      {isExpertPopupOpen && (
        <div className="expert-popup">
          <h4>Available Experts</h4>
          <div className="expert-grid">
            {experts.map((expert, index) => (
              <button
                key={index}
                className={`expert-toggle-button ${expertStatus[index] ? 'selected' : ''}`}
                onClick={() => toggleExpert(index)}
              >
                {expert}
              </button>
            ))}
          </div>
          <button onClick={toggleExpertPopup} className="close-popup-button">Close</button>
        </div>
      )}

      {/* Console Container with Editable Experts */}
      <div className="console-container">
        <Console experts={experts} updateExpertName={updateExpertName} setCurrentLLM={setCurrentLLM} />
      </div>

      {/* Conversation Window Container */}
      <div className="conversation-container">
        <ConversationWindow messages={messages} />
      </div>

      {/* Input Section */}
      <div className="entry-box-container">
        <InputSection
          onPromptSubmit={(prompt) => {
            setMessages([...messages, { text: prompt, isUser: true }]);
            handleSendMessage(prompt);
          }}
          onCopyConversation={() => navigator.clipboard.writeText(messages.map(m => m.text).join('\n'))}
        />
      </div>
    </div>
  );
}

// Console Component with Option Cycling and Editable Experts
function Console({ experts, updateExpertName, setCurrentLLM }) {
  const [currentView, setCurrentView] = useState("default");
  const options = ["Text-To-Speech", "Speech Recognition", "LLM Selection", "Update Experts", "Conversation Select"];
  const [currentOptionIndex, setCurrentOptionIndex] = useState(0);
  const [selectedExpertIndex, setSelectedExpertIndex] = useState(null);
  const [newExpertName, setNewExpertName] = useState("");

  const handleSelectOption = () => setCurrentView(options[currentOptionIndex]);
  const handleBack = () => setCurrentView("default");
  const handleScroll = (direction) => setCurrentOptionIndex((prev) => (direction === 'up' ? (prev === 0 ? options.length - 1 : prev - 1) : (prev === options.length - 1 ? 0 : prev + 1)));
  const startEditingExpert = (index) => {
    setSelectedExpertIndex(index);
    setNewExpertName(experts[index]);
  };
  const saveExpertName = () => {
    updateExpertName(selectedExpertIndex, newExpertName);
    setSelectedExpertIndex(null);
  };

  return (
    <div className="console-grid">
      <div className="settings-display">
        {currentView === "default" ? (
          <div className="console-option">
            {options[currentOptionIndex]}
          </div>
        ) : (
          <div className="settings-options">
            <h3>{currentView}</h3>
            <div className="settings-page-content">
              {currentView === "Text-To-Speech" && (
                <>
                  <p>Enable or disable Text-to-Speech:</p>
                  <button>Enable TTS</button>
                  <button>Disable TTS</button>
                </>
              )}
              {currentView === "Speech Recognition" && (
                <>
                  <p>Control Speech Recognition:</p>
                  <button>Record Speech</button>
                  <button>Check Recording</button>
                </>
              )}
              {currentView === "LLM Selection" && (
                <>
                  <p>Select Language Model:</p>
                  <select onChange={(e) => setCurrentLLM(e.target.value)}>
                    <option>ChatGPT</option>
                    <option>Google Gemini</option>
                    <option>Anthropic Claude</option>
                  </select>
                </>
              )}
              {currentView === "Update Experts" && (
                <div className="experts-grid">
                  {experts.map((expert, index) => (
                    <button key={index} className="expert-button" onClick={() => startEditingExpert(index)}>
                      {expert}
                    </button>
                  ))}
                  {selectedExpertIndex !== null && (
                    <div className="expert-edit-popup">
                      <input type="text" value={newExpertName} onChange={(e) => setNewExpertName(e.target.value)} />
                      <button onClick={saveExpertName}>Save</button>
                    </div>
                  )}
                </div>
              )}
              {currentView === "Conversation Select" && (
                <>
                  <p>Select a conversation to review:</p>
                  <div className="conversation-history">
                    {[...Array(10)].map((_, index) => (
                      <div key={index} className="conversation-item">
                        Conversation {index + 1}
                      </div>
                    ))}
                  </div>
                </>
              )}
            </div>
            <button onClick={handleBack} className="back-button">Back</button>
          </div>
        )}
      </div>

      <div className="settings-buttons">
        <button onClick={() => handleScroll('up')} className="up-arrow">▲</button>
        <button onClick={handleSelectOption} className="select-button">Select</button>
        <button onClick={() => handleScroll('down')} className="down-arrow">▼</button>
      </div>
    </div>
  );
}

export default MultiChatXpertPage;
